    lcs = [[0 for _ in range(n2+1)] for _ in range(n1+1)]

    # Fill lcs[i][j] using dynamic programming
    for i in range(1, n1+1):
        for j in range(1, n2+1):
            if str1[i-1] == str2[j-1]:
                lcs[i][j] = lcs[i-1][j-1] + 1
